webpackJsonp([39791213267039],{433:function(e,t){e.exports={data:{site:{siteMetadata:{title:"chillyBlue",author:"William Chiu"}},markdownRemark:{id:"/Users/williamchiu/Documents/Programming/gatsby-blue/src/pages/2017-02-10-a-work-still-in-progress/2017-02-10-a-work-still-in-progress.markdown absPath of file >>> MarkdownRemark",html:"<p>Woke up today all sore<br>\ntried to ignore it but I could not<br>\nmy throat hurt a lot so I took<br>\nsome medicine.  </p>\n<p>It’s been a while since I’ve sat down to write<br>\nwhile there’s still light and the sun still shines bright<br>\nI do all my work at night and its weird not writing<br>\nwhen its darker and colder outside.  </p>\n<p>Daily posts I say<br>\nbut is it okay if I break that trend<br>\nforget to send my thoughts for the day<br>\nand still say I’m active… somewhat?  </p>\n<p>I wonder why there are people who pray<br>\nand send away their troubles to their god<br>\nis it odd to make noises when eating food<br>\nor does it satisfy some higher power.  </p>\n<p>Benadryl has got me all tired.<br>\nI feel I’m wired all wrong.<br>\nI want to bring people along with me on my journey.<br>\nI hope I end up somewhere.  </p>\n<p>Falling asleep after sleeping<br>\nreaping the benefits of a solid education<br>\ncompensation for the trauma of a sleeping student<br>\none that I hope won’t be me.  </p>\n<p>Looking for praise<br>\nDays are a haze of classes and work.<br>\nI lurk around in a state only semi awake.<br>\nGood grief my throat.  </p>\n<p>Snow on the sidewalks outside,<br>\nWide stretches of land salted,<br>\nrefreezing halted but at what cost.<br>\nIce breaks soles but salt eats soles.  </p>\n<p>Medicine is kicking in<br>\nCan’t win against something I am<br>\nCan only cram work off for sick days<br>\nI learned nothing.  </p>\n<p>Endless rolling stomach rumble,<br>\nAm I humble or am I a nervous wreck.<br>\nI’ll check myself<br>\nto make sure everything is alright.  </p>\n<p>Sometimes I struggle to get the words out.<br>\nI doubt whether I convey what I’m thinking.<br>\nWhen I’m sinking I do a better job.<br>\nReclaiming that feeling of being lost.  </p>",frontmatter:{title:"A Work Still In Progress",date:"February 10, 2017"}}},pathContext:{slug:"/posts/2017-02-10-a-work-still-in-progress/2017-02-10-a-work-still-in-progress/",previous:{fields:{slug:"/posts/2017-02-09-people-units/2017-02-09-people-units/"},frontmatter:{title:"People Units"}},next:{fields:{slug:"/posts/2017-02-11-week-5-impending/2017-02-11-week-5-impending/"},frontmatter:{title:"Week 5 Impending"}}}}}});
